const HomePage = {
  name: 'Home page',
  render: () => html`
    <div class="story-llama-home-page">
      <slate-app-bar>
        <slate-container size="xl">
          <slate-app-nav justify="between" wrap>
            <slate-stack direction="row" align="center" gap="sm">
              <a class="nav-link" data-active="true" href="#">Home</a>
              <a class="nav-link" href="#">Notes</a>
              <a class="nav-link" href="#">Shop</a>
            </slate-stack>
            <slate-stack direction="row" align="center" gap="4xs">
              <a class="social-link" href="#">
                <story-icon-instagram class="nav-icon"></story-icon-instagram>
              </a>
              <a class="social-link" href="#">
                <story-icon-facebook class="nav-icon"></story-icon-facebook>
              </a>
              <a class="social-link" href="#">
                <story-icon-email class="nav-icon"></story-icon-email>
              </a>
            </slate-stack>
          </slate-app-nav>
        </slate-container>
      </slate-app-bar>
      <main>
        <slate-stack gap="2xl">
          <slate-container class="hero-section" size="xl">
            <slate-stack gap="2xl">
              <slate-heading size="5xl">
                Hello! We are the
                <strong>Eyres</strong>
                üëãüèº
              </slate-heading>
              <slate-heading size="xl">
                <slate-link href="https://trevoreyre.com" target="_blank">
                  Trevor
                </slate-link>
                is a software engineer, and
                <slate-link href="https://liaeyre.com" target="_blank">
                  Lia
                </slate-link>
                is a stay at home mom to baby girl Lennon, and our two pups,
                Banana Pig and Mango Salsa.
              </slate-heading>
              <slate-heading size="xl">
                We moved into an RV in July 2019, and started travelling full
                time in the summer of 2020.
              </slate-heading>
            </slate-stack>
            <story-llama-logo></story-llama-logo>
          </slate-container>
          <slate-container size="xl">
            <slate-container align="start" size="sm">
              <slate-stack gap="lg">
                <slate-heading size="2xl" weight="bold">
                  Follow along
                </slate-heading>
                <slate-text size="lg">
                  Follow our adventure on the map below. See where we've been
                  and where we're headed next. If you happen to be in the area,
                  hit us up. We'd love to meet and have a beer!
                </slate-text>
              </slate-stack>
            </slate-container>
          </slate-container>
          <slate-container size="xl">
            <slate-stack align="stretch" gap="2xl">
              <div class="stats-container">
                <story-stat>
                  <story-illustration-sun slot="icon"></story-illustration-sun>
                  <slate-heading size="4xl" weight="bold">1096</slate-heading>
                  <slate-text size="lg" variant="secondary">
                    Days on the road
                  </slate-text>
                </story-stat>
                <story-stat>
                  <story-illustration-map slot="icon"></story-illustration-map>
                  <slate-heading size="4xl" weight="bold">31</slate-heading>
                  <slate-text size="lg" variant="secondary">
                    States visisted
                  </slate-text>
                </story-stat>
                <story-stat>
                  <story-illustration-truck
                    slot="icon"
                  ></story-illustration-truck>
                  <slate-heading size="4xl" weight="bold">16,086</slate-heading>
                  <slate-text size="lg" variant="secondary">
                    Miles towed
                  </slate-text>
                </story-stat>
              </div>
              <div class="map-container">
                <gmp-map
                  center="37.4220656,-122.0840897"
                  zoom="4.5"
                  map-id="${import.meta.env.VITE_GOOGLE_MAPS_MAP_ID}"
                ></gmp-map>
              </div>
            </slate-stack>
          </slate-container>
        </slate-stack>
      </main>
    </div>
  `,
}

class StoryStat extends LitElement {
  render() {
    return html`
      <slate-stack class="stat" direction="row" align="center" gap="sm">
        <div class="icon">
          <slot name="icon"></slot>
        </div>
        <slate-stack class="text" gap="2xs">
          <slot></slot>
        </slate-stack>
      </slate-stack>
    `
  }

  static styles = css`
    .icon {
      inline-size: var(--size-4xl);
      block-size: var(--size-4xl);
    }

    .text {
      min-inline-size: var(--size-6xl);
    }

    @media (max-width: 960px) {
      .stat {
        align-items: flex-start;
        flex-direction: column;
      }
    }
  `
}
if (!customElements.get('story-stat')) {
  customElements.define('story-stat', StoryStat)
}

